        <footer className="flex flex-col items-center px-8 py-16 bg-gray-900 text-white max-md:px-4">
            <div className="flex flex-wrap gap-10 items-start p-8 w-full bg-gray-800 rounded-lg border border-gray-700 shadow-lg max-w-[1312px] max-md:px-5">
                <div className="flex flex-col gap-6 w-full md:w-1/2">
                    <h2 className="text-2xl font-bold text-blue-400">
                        Contact Us
                    </h2>
                    <ContactInfo />
                </div>
                <div className="flex flex-col gap-6 w-full md:w-1/2">
                    <h2 className="text-2xl font-bold text-blue-400">
                        Follow Us
                    </h2>
                    <SocialLinks />
                </div>
            </div>
            <div className="mt-8 text-center text-sm text-gray-500">
                Â© {new Date().getFullYear()} Your Company Name. All rights
                reserved.
            </div>
        </footer>
    );
}

export default Footer;
